import React, { useState, useEffect } from 'react';
import Papa from 'papaparse';
import { Line, Pie, Bar, Radar, Doughnut, Scatter } from 'react-chartjs-2';
import {
  Chart as ChartJS,
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  Title,
  Tooltip,
  Legend,
  ArcElement, // For Pie/Doughnut
  RadarElement, // For Radar
  BarElement, // For Bar chart
  Filler, // For filling the Radar chart
} from 'chart.js';
import { CircleLoader } from 'react-spinners'; // Updated import for CircleLoader
import './Dashboard.css';

// Register necessary ChartJS components
ChartJS.register(
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  Title,
  Tooltip,
  Legend,
  ArcElement,
  RadarElement,
  BarElement,
  Filler // To make radar charts fill
);

function Dashboard() {
  const [data, setData] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    Papa.parse('https://docs.google.com/spreadsheets/d/e/2PACX-1vSTTSyOvOYmKiGeKXUUzxGWjQ7z9QpoUv1rFM1kkz5g7_vgKNmbiOcZPBQnyQMQCLJcFTS_rJ03KVHD/pub?gid=0&single=true&output=csv', {
      download: true,
      header: true,
      dynamicTyping: true,
      complete: (result) => {
        setData(result.data);
        setLoading(false);
      },
    });

    return () => {
      const canvas = document.getElementsByTagName('canvas');
      if (canvas.length > 0) {
        const chart = ChartJS.getChart(canvas[0]);
        if (chart) {
          chart.destroy();
        }
      }
    };
  }, []);

  // Extract metrics from data
  const engagementData = data.map((entry) => entry['Engagement (%)']);
  const reachData = data.map((entry) => entry['Reach']);
  const impressionsData = data.map((entry) => entry['Impressions']);
  const followersData = data.map((entry) => entry['Followers Gained']);
  const dates = data.map((entry) => entry['Date']);
  const platforms = ['Instagram', 'Facebook', 'Twitter', 'LinkedIn']; // Example platforms
  const engagementByPlatform = platforms.map((platform) => Math.floor(Math.random() * 100)); // Random data for platforms

  // Chart data for Engagement Rate vs Time (Line chart)
  const engagementChartData = {
    labels: dates,
    datasets: [
      {
        label: 'Engagement Rate (%)',
        data: engagementData,
        borderColor: 'rgba(75,192,192,1)',
        fill: false,
        tension: 0.1,
      },
    ],
  };

  // Chart data for Followers Gained vs Time (Line chart)
  const followersChartData = {
    labels: dates,
    datasets: [
      {
        label: 'Followers Gained',
        data: followersData,
        borderColor: 'rgba(153,102,255,1)',
        fill: false,
        tension: 0.1,
      },
    ],
  };

  // Bar chart for Daily Engagement Comparison
  const barChartData = {
    labels: dates,
    datasets: [
      {
        label: 'Daily Engagement',
        data: engagementData,
        backgroundColor: 'rgba(255,99,132,0.2)',
        borderColor: 'rgba(255,99,132,1)',
        borderWidth: 1,
      },
    ],
  };

  // Doughnut chart for Engagement by Platform
  const doughnutChartData = {
    labels: platforms,
    datasets: [
      {
        data: engagementByPlatform,
        backgroundColor: ['rgba(75,192,192,0.5)', 'rgba(153,102,255,0.5)', 'rgba(54,162,235,0.5)', 'rgba(255,159,64,0.5)'],
        borderColor: ['rgba(75,192,192,1)', 'rgba(153,102,255,1)', 'rgba(54,162,235,1)', 'rgba(255,159,64,1)'],
        borderWidth: 1,
      },
    ],
  };

  // Radar chart for Monthly Performance Comparison
  const radarChartData = {
    labels: ['Reach', 'Impressions', 'Engagement', 'Followers Gained'],
    datasets: [
      {
        label: 'Monthly Performance',
        data: [
          reachData.reduce((acc, curr) => acc + curr, 0),
          impressionsData.reduce((acc, curr) => acc + curr, 0),
          engagementData.reduce((acc, curr) => acc + curr, 0),
          followersData.reduce((acc, curr) => acc + curr, 0),
        ],
        backgroundColor: 'rgba(75,192,192,0.2)',
        borderColor: 'rgba(75,192,192,1)',
        borderWidth: 1,
      },
    ],
  };

  // Scatter chart for Followers Gained vs Impressions
  const scatterChartData = {
    datasets: [
      {
        label: 'Followers vs Impressions',
        data: followersData.map((followers, index) => ({
          x: followers,
          y: impressionsData[index],
        })),
        backgroundColor: 'rgba(255,99,132,0.6)',
        borderColor: 'rgba(255,99,132,1)',
        borderWidth: 1,
      },
    ],
  };

  // If data is still loading, show loading spinner
  if (loading) {
    return (
      <div className="loading-container">
        <CircleLoader color="#00BFFF" size={80} />
        <p>Loading data...</p>
      </div>
    );
  }

  return (
    <div className="dashboard-container">
      <h2>Social Media Performance Dashboard</h2>

      <div className="chart-container">
        <div className="chart-card">
          <h3>Engagement Rate Over Time</h3>
          <Line data={engagementChartData} />
        </div>

        <div className="chart-card">
          <h3>Followers Gained Over Time</h3>
          <Line data={followersChartData} />
        </div>

        <div className="chart-card">
          <h3>Daily Engagement Comparison</h3>
          <Bar data={barChartData} />
        </div>

        <div className="chart-card">
          <h3>Engagement by Platform</h3>
          <Doughnut data={doughnutChartData} />
        </div>

        <div className="chart-card">
          <h3>Monthly Performance</h3>
          <Radar data={radarChartData} />
        </div>

        <div className="chart-card">
          <h3>Followers vs Impressions</h3>
          <Scatter data={scatterChartData} />
        </div>
      </div>
    </div>
  );
}

export default Dashboard;
